    public class Solution
    {
        public int LengthOfLongestSubstring(string s)
        {
            if (s.Equals(string.Empty)) return 0;

            int Longest = 1,StartIndex = 0;
            bool[] lsMain = new bool[128];

            for (int i = 0; i < s.Length;i++ )
            {
                int ValueOfInt = (int)s[i];
                if (lsMain[ValueOfInt] == false)
                {
                    lsMain[ValueOfInt] = true;
                    Longest = Math.Max(Longest, i - StartIndex);
                }
                else
                {
                    StartIndex = i;
                    lsMain = new bool[128];
                }
            }
            Longest = Math.Max(Longest, s.Length - StartIndex);

            return Longest;
        }
    }
